local LandData = BaseClass("LandData")

local function __init(self)
    self.finishZone = 0 -- 完成区域的 order
    self.finishBlock = 0 -- 完成地格的 order
    self.finishIndex = 0 -- 当前地格完成进度
    self.rewardRecord = {} -- 地块领奖记录 Dict<id, bool>
    self.unlockZone = 0--已解锁迷雾的zone order
end

local function Parse(self, serverData)
    if serverData.finishZone then
        self.finishZone = serverData.finishZone
    end
    if serverData.finishBlock then
        self.finishBlock = serverData.finishBlock
    end
    if serverData.finishIndex then
        self.finishIndex = serverData.finishIndex
    end
    if not string.IsNullOrEmpty(serverData.rewardRecord) then
        self.rewardRecord = {}
        local spls = string.split(serverData.rewardRecord, ";")
        for _, spl in ipairs(spls) do
            self.rewardRecord[tonumber(spl)] = true
        end
    end
    if serverData.unlockZone then
        self.unlockZone = serverData.unlockZone
    end
end

local function IsReceivedReward(self, id)
    return self.rewardRecord[id] or false
end

LandData.__init = __init

LandData.Parse = Parse
LandData.IsReceivedReward = IsReceivedReward

return LandData